import { getChainOptions, WalletProvider } from '@terra-money/wallet-provider';
import { ConnectSample } from 'components/ConnectSample';
import { QuerySample } from 'components/QuerySample';
import { SignSample } from 'components/SignSample';
import { TxSample } from 'components/TxSample';
import SingleNFT  from 'components/singleNFT/SingleNFT';
import React from 'react';
import ReactDOM from 'react-dom';
import './style.css';

function App() {
  return (
    <main
      style={{ margin: 20, display: 'flex', flexDirection: 'column', gap: 40 }}
    >
      <ConnectSample />
      <QuerySample />
      <TxSample />
      <SignSample />
      <div>
      <SingleNFT
        nftImage="https://cdn2.bulbagarden.net/upload/thumb/4/49/Ash_Pikachu.png/1200px-Ash_Pikachu.png"
        nftTitle="titulo"
        nftId="000"
        nftPriceFiat="10" 
        nftPriceCrypto="0.1"
       />
       <SingleNFT
        nftImage="https://cdn2.bulbagarden.net/upload/thumb/4/49/Ash_Pikachu.png/1200px-Ash_Pikachu.png"
        nftTitle="titulo"
        nftId="000"
        nftPriceFiat="10" 
        nftPriceCrypto="0.1"
       />
       <SingleNFT
        nftImage="https://cdn2.bulbagarden.net/upload/thumb/4/49/Ash_Pikachu.png/1200px-Ash_Pikachu.png"
        nftTitle="titulo"
        nftId="000"
        nftPriceFiat="10" 
        nftPriceCrypto="0.1"
       />
       <SingleNFT
        nftImage="https://cdn2.bulbagarden.net/upload/thumb/4/49/Ash_Pikachu.png/1200px-Ash_Pikachu.png"
        nftTitle="titulo"
        nftId="000"
        nftPriceFiat="10" 
        nftPriceCrypto="0.1"
       />
      </div>

    </main>
  );
}

getChainOptions().then((chainOptions) => {
  ReactDOM.render(
    <WalletProvider {...chainOptions}>
      <App />
    </WalletProvider>,
    document.getElementById('root'),
  );
});
